import { Row, Col } from "react-bootstrap";

const FormsSection = () => {
  return (
    <React.Fragment>
      <hr className="separator-sh"></hr>
      <h1>Formularze online</h1>
      <Row>
        <Col>
          <img src="../static/img/graph.png" className="step-by-step" />
        </Col>
        <Col></Col>
      </Row>
    </React.Fragment>
  );
};

export default FormsSection;
